import TrashCan from './TrashCan.js';


function Exercise( props ) {  
  return (
    <tr>
      <td>{ props.id }</td>
      <td>{ props.name }</td>
      <td>{ props.type }</td>
      <td>{ props.timing }</td>
      <td>{ props.target} </td>
    </tr>
  );
}

export default Exercise;
